import React from 'react';
import './Menu.scss';


interface Song {
    artist: string;
    songName: string;
    duration: number
}

const Menu: React.FC<Song> = () => {
    return(
        <div className="menu">
            {/* valitud loo preview */}
            <div className="container1">
                Blacm
            </div>
            {/* lugude list */}
            <div className="container2">
                <ul>
                    <li>Katy Perry - Fireworks</li>
                    <li>50 Cent</li>
                    <li>Eminem</li>
                </ul>
            </div>
        </div>
    )
}

export default Menu;
